
import { useSpring, animated } from '@react-spring/web';
import {useEffect, useState} from "react";

const CloudAnimation = () => {
    const [text, setText] = useState('Initial Text');
    const [smallText, setSmallText] = useState('');

    const [animationProps, api] = useSpring(() => ({
        opacity: 0,
        config: { duration: 1000 },
    }));

    useEffect(() => {
        const animate = async () => {
            setText("Let's Play a Game! ");
            await api.start({ opacity: 1 });
            await sleep(3000);
            await api.start({ opacity: 0 });
            await sleep(1000);
            setText('Let your Child Try!');
            setSmallText('Match the Shapes!');
            await api.start({ opacity: 1 });
            await sleep(10000);
            await api.start({ opacity: 0 });
            await sleep(1000);
            setText('Let me call Hans!');
            setSmallText("He's a Teacher!");
            await api.start({ opacity: 1 });
            await sleep(10000);
            await api.start({ opacity: 0 });
            await sleep(3000);
            setText('For Us, Adults');
            setSmallText(" this game is simple!");
            await api.start({ opacity: 1 });
            await sleep(5000);
            await api.start({ opacity: 0 });
            await sleep(1000);
            setText('    But for Kids    ');
            setSmallText("It is quite hard");
            await api.start({ opacity: 1 });
            await sleep(5000);
            await api.start({ opacity: 0 });
            await sleep(1000);
            setText('Motor Skills and');
            setSmallText("shape Recognition, logic");
            await api.start({ opacity: 1 });
            await sleep(5000);
            await api.start({ opacity: 0 });
            await sleep(1000);
            setText('Not so Simple!');
            setSmallText("Edurino Will Help!");
            await api.start({ opacity: 1 });
            await sleep(5000);
            await api.start({ opacity: 0 });





        };

        animate();
    }, [api]);

    const sleep = (duration) => {
        return new Promise((resolve) => setTimeout(resolve, duration));
    };

    return <animated.div  className={"cloud2"}  style={animationProps}>
        <svg  width="800" height="800" viewBox="0 0 637 637" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
            <rect width="637" height="636.5" fill="url(#pattern0_95_19)"/>
            <defs>
                <pattern id="pattern0_95_19" patternContentUnits="objectBoundingBox" width="1" height="1">
                    <use xlinkHref="#image0_95_19" transform="scale(0.000784929)"/>
                </pattern>
                <image id="image0_95_19" width="1274" height="1273" xlinkHref="data:image/png;base64,"/>
            </defs>

        </svg>
        <div className={"cloud-text2"}> <p> {text} </p>
            <p style={{fontSize: "48px", transform: "translateY(-50px)"}}> {smallText} </p>
        </div>
    </animated.div>;
};

export default CloudAnimation;